        // {"projectId":24,"projectName":"RACRS - 10889","projectDescription":"<div class=\"ExternalClass57D4CF65D89648EA828173353B42FD26\">The objective of the Apache SMART program is to perform Modeling and Simulation (M&amp;S) risk reduction activities utilizing the Government-owned Apache Risk and Cost Reduction System (RACRS). Camber has served as an engineering extension of the Apache project office from 2000 to 2015 to assist with the evolution of aircraft modification concepts into solutions that meet the needs of Army Aviators thereby avoiding rework due to misunderstood or loosely defined requirements. In support of this objective, Camber developed, maintains, and operates an Apache laboratory with aircraft software and hardware capabilities for the purposes of prototyping and mission-based evaluations/trials.  Camber engineers also provide project sustainment support to address maintenance, data backup, obsolescence, currency with the fielded aircraft, and upgrade of technology to perpetuate relevancy of the RACRS as a prototyping test bed.  On average, the RACRS program has 8-12 active task orders at all times, each with 9-18 months of duration. The conduct of simulated flight test rehearsals verifies and validates hardware and software upgrades substantially lowering the risk and cost of repetitive flight testing</div>","businessUnit":"TCE","projectNumber":"10889","projectManager":null,"customer":"USA","customerDetail":null,"contractType":"CPFF","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-18T21:01:16.000Z","updated":"2018-06-18T21:01:16.000Z"},
