        // {"projectId":33,"projectName":"UAE CBRNE Academic Training (10881)","projectDescription":"<div class=\"ExternalClassAE7FB69A1F434A9D94306641145BC1BE\">Camber provides 22 USMC installations worldwide with Contractor Logistics Support (CLS) which includes total asset management for over $50M of CBRNE equipment. We deploy Subject Matter Experts (SMEs) at Continental United States (CONUS) and Outside the Continental United States (OCONUS) Marine Corps locations.  Camber conducts training; acquisition, technical, and engineering support; and supply chain management, to include shelf-life monitoring and configuration management.  We manage inventory, conduct maintenance, store CBRNE equipment, and distribute the equipment to installations as needed.  We provide real-time visibility of all assets program-wide which gives the Headquarters Marine Corps (HQMC) the ability to shift equipment in response to threat situations.  Camber provides total asset management for over 1,900 line items and over 200,000 assets/pieces of CBRNE and First Responder/Receiver equipment.  We also provide training and exercise support, development and implementation of installation CBRNE protection plan annexes in installation incident response plans, and equipment maintenance and sustainment for CBRNE IPP.  CLS also includes management and technical support to the installations as required for Organizational Doctrine, Training, Operations, and related CBRNE and emergency management issues</div>","businessUnit":"P&I","projectNumber":"10881","projectManager":"Tunstall, Stanley (HII-TSD)","customer":"USMC","customerDetail":null,"contractType":null,"contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-18T21:01:17.000Z","updated":"2018-06-18T21:01:17.000Z"},
