        // {"projectId":60,"projectName":"NAVY NIC OCO (10867.010)","projectDescription":"<div class=\"ExternalClass82295FB54681498CBCD2F9895ACF9773\">This Logistics Domain defines the program, engineering, and technical support services required for the Joint Program Executive Office for Chemical and Biological Defense (JPEO-CBD) and all the Joint Project Management Offices (JPMOs) which report directly to the JPEO-CBD.  JPEO-CBD manages a dynamic and diverse portfolio of critical warfighting capabilities that require cohesive and innovative total life cycle systems management approaches to rapidly respond to the needs of the Force balanced by affordable sustainment strategies.  Due to the schedule-driven nature and criticality of solutions to the Warfighter, a cohesive strategy for rapid assessments, evaluation, fielding, New Equipment Training (NET), sustainment, and continuous product improvement activities are essential to the JPEO-CBD support strategy to its customers.  This domain establishes the requirement to provide Systems Engineer, Configuration Management Specialist, Risk Management Specialist, Science and Technology Analyst, Architecture Support, Communications Analyst and Test Analyst support, as required, to assist the JPEO-CBD as the Total Life cycle Systems Manager for the Chemical and Biological Defense Programs (CBDPs) within the Department of Defense (DoD).</div>","businessUnit":"P&I","projectNumber":"10867","projectManager":"Defebbo, Robert (HII-TSD)","customer":"USN","customerDetail":null,"contractType":null,"contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:12:19.000Z","updated":"2018-06-26T11:12:19.000Z"},
