        // {"projectId":104,"projectName":"Ft. Rucker Spt - 10057.058","projectDescription":"<div class=\"ExternalClassCEA63DCE4A67474AADC269C4D55FD901\">The objective of this task order is to provide on-site technical and analytical support to the Program Executive Office (PEO) Aviation, the Concept and Requirements Directorate, (CRD), Ft Rucker AL, The U.S. Army Aviation Center  of Excellence (USAACE), in support of the TRADOC Capability Managers (TCMs),  Aviation Project Management Offices (PMOs) for Apache Attack Helicopter (AAH), Cargo Helicopter and the Product Manager for Aviation Ground Support Equipment (AGSE) in the Aviation Systems PMO; and to provide on-site support for PEO-AVN Headquarters in Huntsville, AL. Technical support of these major Army weapons systems, TRADOC Capability Manager (TCM-R/A, TCM-Lift/Cargo, TCM Unmanned Aerial Systems (UAS) and PM AGSE requires extensive and diverse technical expertise and short term analytical technical support for the National Personnel Security System (NSPS) training program. This also includes support for the Objective Force, Future Combat Systems, and participation in Initial Operational Test and Evaluation (IOT&amp;E) evaluations, Limited User Test (LUTs), Advanced Warfighting Experiments (AWEs) and Advanced Concepts and Technical Demonstrations (ACTDs). Both the Apache and Cargo weapons systems have been fielded in significant number and are undergoing performance, durability and quality engineering changes based upon its fielded performance. AGSE is fielded everywhere aviation is based. It will also provide some administrative support for Headquarters, PEO-AVN.  </div>","businessUnit":"TCE","projectNumber":"10057","projectManager":"Brooks, John (HII-TSD)","customer":"USA","customerDetail":null,"contractType":"T&M","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wr