        // {"projectId":106,"projectName":"FMS Apache - 10057.057","projectDescription":"<div class=\"ExternalClass6C60BCBD841845B89E56DC87C5DB852F\">The Camber staff has supported the International Apache Office, within the Apache Project Office, continuously over the past 15 years, providing program management, systems engineering, sustainment planning and execution for the world-wide Apache fleet consisting of 14 individual active country programs.  During the FMS planning stage, analysis of alternatives to meet the country operational and budgetary goals are evaluated, and the development and integration of unique capabilities are presented with alternatives for country consideration.  Drafts for the development of a total package to establish a full operational capability is conducted and merged with full pricing and associated schedules.  Upon, security assistance review and country acceptance, the Camber staff executes the FMS case with coordination and contracting actions to ensure cost, schedule, quality and performance documented is obtained.        </div>","businessUnit":"TCE","projectNumber":"10057","projectManager":"Brooks, John (HII-TSD)","customer":"USA","customerDetail":null,"contractType":"T&M","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:19:48.000Z","updated":"2018-06-26T11:19:48.000Z"},
