        // {"projectId":121,"projectName":"CTL (10878)","projectDescription":"<div class=\"ExternalClass9D7464E075D44BE5AB8F7B513CB9E0CF\">Cambers Conformance Test Laboratory (CTL) operates as a third party conformance test laboratory to provide conformance testing in support of the Critical Reagent Programs (CRP) mission.  Cambers CTL has been instrumental in developing the unique processes and procedures used for the conformance testing of CRP lateral flow immunoassays(LFI) used in a variety of detection platforms (i.e. HHA, JBPDS, and JPS).  Prior to the existence of the Camber CTL, a formalized third party QA/QC process did not exist in the acceptance of the manufactured LFI and electrochemiluminescence (ECL) assays. Cambers CTL provides Conformance Test Reports (CTR) to CRP and provides other testing support as directed. Cambers CTL has a Quality Management System (QMS) that is accredited to ISO-17025, which is a standard used for calibration and testing laboratories.  The accreditation meets or exceeds the requirements of ISO-9001.  The CTL has a Secret level facility clearance granted by the Defense Security Service, and all CTL staff members have Secret level personnel security clearances.</div>","businessUnit":"P&I","projectNumber":"10878","projectManager":"Graves, Carcie (HII-TSD)","customer":"USA","customerDetail":null,"contractType":null,"contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:19:50.000Z","updated":"2018-06-26T11:19:50.000Z"},
