        // {"projectId":128,"projectName":"AED Maintenance Engineering Spt - 10931.001","projectDescription":"<div class=\"ExternalClassD59EE9CA50F645E790364E15664DC512\">Provide Technical Support  Engineering Services for the Aviation Missile Research, Development and Engineering Center (AMRDEC), Aviation Engineering Directorate (AED), Maintenance Engineering Division (AEM).  This support provides a broad spectrum of engineering and technical support encompassing maintenance policies and procedures; upgrades and repairs; technical data revision/ improvement; prototyping, and corrosion prevention and control. Our experts will develop and implement new maintenance concepts in support of Army and multi-service aircraft, associated power plants, components and subassembly items. Continue to improve procedures and processes through frequent and vigilant observation while visiting depot repair shops. Assist the depot artisans in assuring proper processes are followed and evaluating/ resolving engineering related production problems affecting quality and schedule. Our field and depot liaison engineering services to the Army, Navy, Air Force and FMS will keep the warfighter equipped with the worlds best quality aircraft and components.</div>","businessUnit":"TCE","projectNumber":"10931","projectManager":"Roberson, Rebecca (HII-TSD)","customer":"USA","customerDetail":null,"contractType":"T&M","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:19:51.000Z","updated":"2018-06-26T11:19:51.000Z"},
