        // {"projectId":138,"projectName":"LCMC Cost Analysis Spt - 10466.120","projectDescription":"<div class=\"ExternalClass34AB5397381D40B0ABE5792846D7345E\">Cost analysis, analytical and technical services and products for the TACOM Cost and Systems Analysis (C&amp;SA) office. Technomics provides services in the areas of cost, economic, and technical analysis of major weapon system programs of the Department of Defense. These services include cost, economic, and technical analysis for combat support  and ground combat weapon systems, information management systems, as well as associated acquisition/financial management reporting. This task became much larger and complex on the administrative side than was anticipated. Once we adapted our up-front approach for processing each subtask request, the execution phase flowed nicely without any issues. The customer was pleased with our quality of product/services, schedule compliance, cost control, and business relations.</div>","businessUnit":"TCE","projectNumber":"10466","projectManager":"Davis, Kirk (HII-TSD)","customer":"USA","customerDetail":null,"contractType":"FFP","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:26:10.000Z","updated":"2018-06-26T11:26:10.000Z"},
        // {"projectId":139,"projectName":"HERCULES FSR SUPPORT - 10631","projectDescription":"<div class=\"ExternalClass0099E14E3F914439875ABC95F3AC9DCA\">The HERCULES Support Task provided to BAE (UDLP) and the government the required experience to efficiently and effectively deprocess, issue and train gaining units on the M88A2 tank retriever.  The government had fielded an all military team but due to the constant turnover of personnel and their lack of hands on experience the Customer PM HBCT transitioned to the current model of long term civilian contractor team.  This also enables a closer relationship between the OEM and the fielding team.</div>","businessUnit":"TCE","projectNumber":"10631","projectManager":"Davis, Kirk (HII-TSD)","customer":"USA","customerDetail":null,"contractType":"T&M","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:26:10.000Z","updated":"2018-06-26T11:26:10.000Z"},
        // {"projectId":140,"projectName":"AETC OPS TRAINING - 10761","projectDescription":"<div class=\"ExternalClass8C869B1A81F846BDA61A63D479155113\">The purpose of this task order is to provide Operations Training Analysis Support Services to the Requirements &amp; Resources Division, Operations Directorate, at Headquarters Air Education and Training Command (HQ AETC), Randolph AFB, TX. The support is to provide contract support to ensure adequate resources are planned for, programmed for, and budgeted for all AETC flying and technical training activities. The contract shall supply two positions. This contract will provide on-site support of AETCs mission by providing analysis, assessment and management associated with the technical and flying training funding activities. To address the tasking identified above, HQ AETC is requesting necessary assessment, analysis, and database management services to support HQ AETCs Budget and Programs Branch. In providing this support, the contractor shall interface with relevant members of the HQ AETC staff, other USAF major commands</div>","businessUnit":"TCE","projectNumber":"10761","projectManager":"Davis, Kirk (HII-TSD)","customer":"USAF","customerDetail":null,"contractType":"FFP","contractValue":null,"practices":[],"placeOfPerformance":null,"primeContractor":null,"primeContractorName":null,"securityClearedWork":null,"securitySCIF":null,"technicalLead":null,"createdBy":"Wright, Rachel (HII-TSD)","updatedBy":"Wright, Rachel (HII-TSD)","created":"2018-06-26T11:26:10.000Z","updated":"2018-06-26T11:26:10.000Z"},
